import BoardMembersComponent from "./BoardMembersComponent";
import useStore from '../../../stores/useStore';
import shallow from 'zustand/shallow';
import { useEffect } from "react";

const getState = state => [
    state.directorList,
    state.getDirectors,
    state.representativeList,
    state.getRepresentatives,
    state.boardMembers,
    state.setBoardMembers,
    state.getBoardMembers
];

const BoardMembers = () => {
    const [directorList, getDirectors, getRepresentatives, boardMembers, setBoardMembers, getBoardMembers] = useStore(getState, shallow);

    useEffect(()=>{
        getDirectors();
    }, []);

    const args = {
        directorList,
        representativeList: boardMembers.representativeList,
        setDirectorList: directorList => {
            setBoardMembers({property: "directorList", value: directorList})
        },
        setRepresentativeList: representativeList => {
            setBoardMembers([{property: "representativeList", value: representativeList}])
        },    
    };
    return <BoardMembersComponent {...args} />
}

export default BoardMembers;
